import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import FormatListBulletedAddIcon from '@mui/icons-material/FormatListBulletedAdd';
import FormatListBulletedIcon from '@mui/icons-material/FormatListBulleted';
import ShareIcon from '@mui/icons-material/Share';
import ChecklistRtlIcon from '@mui/icons-material/ChecklistRtl';
import BuildIcon from '@mui/icons-material/Build';
import LogoutIcon from '@mui/icons-material/Logout';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MenuIcon from '@mui/icons-material/Menu';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';

function DashBoard() {
  const navigate = useNavigate();
  const [value, setValue] = useState('1');
  const [open, setOpen] = useState(true);
  const logout = () => {
    localStorage.removeItem('access');
    localStorage.removeItem('refresh');
    navigate('/');
  };
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  const toggleSidebar = () => {
    setOpen(!open);
  };

  return (
    <div className="bg-slate-200 min-h-screen text-black flex">
      <TabContext value={value}>
        <Box sx={{ display: 'flex', width: '100%' }}>
          <Box sx={{ borderRight: 1, borderColor: 'divider', display: 'flex', flexDirection: 'column', alignItems: 'center', backgroundColor: '#080808', py: 2, width: open ? 200 : 80, minHeight: '100vh', transition: 'width 0.3s ease', gap: 2 }}>
            <button onClick={toggleSidebar} className="text-white hover:text-blue-400 mb-6">{open ? <ChevronLeftIcon /> : <MenuIcon />}</button>
            <TabList orientation="vertical" onChange={handleChange} aria-label="Vertical icon tabs" sx={{ '& .MuiTab-root': { minWidth: 0, padding: '12px', color: 'white', justifyContent: open ? 'flex-start' : 'center', flexDirection: open ? 'row' : 'column', gap: open ? 2 : 0 }, '& .Mui-selected': { color: '#6495ED' } }}>
              <Tab icon={<AccountCircleIcon sx={{ fontSize: 30 }} />} label={open ? 'Account' : ''} value="0" active />
              <Tab icon={<FormatListBulletedIcon sx={{ fontSize: 30 }} />} label={open ? 'Elenco' : ''} value="1" />
              <Tab icon={<FormatListBulletedAddIcon sx={{ fontSize: 30 }} />} label={open ? 'Aggiungi' : ''} value="2" />
              <Tab icon={<ShareIcon sx={{ fontSize: 30 }} />} label={open ? 'Condividi' : ''} value="3" />
              <Tab icon={<ChecklistRtlIcon sx={{ fontSize: 30 }} />} label={open ? 'Checklist' : ''} value="4" />
              <Tab icon={<BuildIcon sx={{ fontSize: 30 }} />} label={open ? 'Impostazioni' : ''} value="5" />
            </TabList>
            <Box sx={{ flexGrow: 1 }} />
            <button onClick={logout} className="mb-6 px-4 py-2 bg-blue-600 rounded hover:bg-red-500 text-white flex items-center justify-center w-[90%]" title="Logout">
              <LogoutIcon sx={{ fontSize: 30 }} />
              {open && <span className="ml-2">Logout</span>}
            </button>
          </Box>
          <Box sx={{ flexGrow: 1, p: 4 }}>
            <TabPanel value="1">Contenuto elenco</TabPanel>
            <TabPanel value="2">Contenuto aggiunta</TabPanel>
            <TabPanel value="3">Contenuto condivisione</TabPanel>
            <TabPanel value="4">Contenuto checklist</TabPanel>
            <TabPanel value="5">Contenuto impostazioni</TabPanel>
          </Box>
        </Box>
      </TabContext>
    </div>
  );
}

export default DashBoard;
